$(document).ready(function(){
    let projectLogo = document.getElementById("styx-logo");
    projectLogo.style.backgroundImage = 'url(data:image/svg+xml;base64,)';
    projectLogo.style.backgroundSize = '80%';
    projectLogo.style.backgroundRepeat = 'no-repeat';
    projectLogo.style.backgroundPosition = 'center';
    document.getElementById("styx-text").innerHTML = "";
    let moreVert = document.getElementById("styx-more-vert");
    moreVert.style.color = "black"
    moreVert.classList.remove('waves-light');
    moreVert.classList.add('waves-red');
});

